value_t mkcell (value_t car, value_t cdr) {
    if ((car.payload.vp_u64 == 0) && (cdr.tag == VT_U64))
        return cdr;
    if (cdr.tag == VT_U64) {
        switch (car.tag) {
            case VT_U64: {
                u64 x0 = car.payload.vp_u64;
                u64 x1 = cdr.payload.vp_u64;
                u64 y0 = x0 & 0xFFFFFFFFLL;
                u64 y1 = x1 & 0xFFFFFFFFLL;
                if ((x0 == y0) && (x1 == y1)) {
                    value_t r;
                    r.tag = VT_U32;
                    r.payload.vp_u64 = (y0 << 32) | y1;
                    return r;
                }
            } break;
            case VT_C64: {
                u64 x0 = car.payload.vp_u64;
                u64 x1 = cdr.payload.vp_u64;
                u64 y0 = x0 & 0xFFFFFFFFLL;
                u64 y1 = x1 & 0xFFFFFFFFLL;
                if ((x0 == y0) && (x1 == y1)) {
                    value_t r;
                    r.tag = VT_C32;
                    r.payload.vp_u64 = (y0 << 32) | y1;
                    return r;
                }
            } break;
            default: break;
        }
    }
    if (heap_count >= HEAP_SIZE - 1) {
        write(2, "HEAP OVERFLOW\n", 14);
        exit(1);
    }
    u64 cell_index = heap_next;
    volatile cell_t *cell = heap + cell_index;
    while ((cell->refs > 0) && (cell_index < HEAP_SIZE)) { cell++; cell_index++; }
    if (cell_index >= HEAP_SIZE - 1) {
        write(2, "HEAP OVERFLOW\n", 14);
        exit(1);
    }
    u64 saved_index = cell->cdr.payload.vp_u64;
    heap_next = (usize)(saved_index ? saved_index : cell_index+1);
    heap_count++;
    cell->refs = 1;
    cell->car = car;
    cell->cdr = cdr;
    value_t v = {0};
    v.tag = VT_C64;
    v.payload.vp_u64 = cell_index;
    return v;
}

void do_pack_uncons() {
    value_t val = pop_value();
    switch (val.tag) {
        case VT_U64: {
            value_t nil = { 0 };
            push_value(nil);
            push_value(val);
        } break;
        case VT_U32: {
            u64 vv = val.payload.vp_u64;
            u64 lo = vv & 0xFFFFFFFF;
            u64 hi = vv >> 32;
            push_u64(hi); push_u64(lo);
        } break;
        case VT_C64: {
            volatile cell_t* cell = heap + val.payload.vp_u64;
            value_t car = cell->car;
            value_t cdr = cell->cdr;
            incref(car); incref(cdr); decref(val);
            push_value(car); push_value(cdr);
        } break;
        case VT_C32: {
            u64 vv = val.payload.vp_u64;
            u64 lo = vv & 0xFFFFFFFF;
            u64 hi = vv >> 32;
            value_t car;
            car.tag = VT_C64;
            car.payload.vp_u64 = hi;
            push_value(car); push_u64(lo);
        } break;
    }
}

u64 get_top_data_tag() {
    value_t v = pop_value();
    u64 result = 0;
    switch (v.tag) {
        case VT_C64: {
            volatile cell_t *c = heap + v.payload.vp_u64;
            result = c->cdr.payload.vp_u64;
        } break;
        case VT_U64: {
            result = v.payload.vp_u64;
        } break;
        case VT_U32: {
            result = v.payload.vp_u64 & 0xFFFFFFFF;
        } break;
        case VT_C32: {
            result = v.payload.vp_u64 & 0xFFFFFFFF;
        } break;
    }
    push_value(v);
    return result;
}

